import React from 'react'
import {
    BrowserRouter as Router,
  } from "react-router-dom";
  import { Navbar,Nav,Form,FormControl,Button } from 'react-bootstrap'


class BootstrapNavbar extends React.Component{

    render(){
        return(
            <div>
                <div className="row">
                    <div className="col-md-12">
                      <Router>
                            <Navbar bg="light" variant="light" expand="lg" sticky="top">
                                <Navbar.Brand href="#home">Iron Notes</Navbar.Brand>
                                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                                <Navbar.Collapse id="basic-navbar-nav">
                                    <Nav className="mr-auto">
                                    </Nav>
                                    <Form inline>
                                    <FormControl type="text" placeholder="Search" className="form-control mr-sm-2" />
                                    <Button className='btn btn-outline-success my-2 my-sm-0' variant="outline-success">Search</Button>
                                    </Form>
                                </Navbar.Collapse>
                            </Navbar>
                            </Router>
                    </div>
                </div>
            </div>
        )  
    }
}

export default BootstrapNavbar;
